import React from 'react';
import {Link} from '../routes';

const Headers =()=>{
   return <div class="ui menu" style={{marginTop:'20px'}}>
  <Link route='/' class="item">CrowdCoins</Link> 
  
  <div class="right menu">
  <Link route='/' class="item"> Campaigns</Link>
  <Link route='/Campaigns/create' class="item">+</Link>  
  </div>
</div>
}
export default Headers;
